@farisf9 🚨 بعد عامين و 9 اشهر من الغيبوبة ، اخ عبدالحق نوري يؤكد ان أخيه لم يعد في غيبوبته .. و يُصرح : لم يعد في غيبوبته ، انه مستيقظ و يعطس و يأكل ، و لكنه لا يقوم بسهولة من فراشه ، يعتمد علينا كثيرًا. 
